					//console.log("Cuantos btns: " + this.btn_array.length);
					console.log("this.btn_array[" + (parseInt(e.currentTarget.name.substr(3)) - 1) + "] = 1");
					this.btn_array[parseInt(e.currentTarget.name.substr(3)) - 1] = 1;
					var vistos_todos = true; // variable interna y solo vive en esta funciÃ³n
